#include <hackerrank_gtest.h>
#include "funny_string.h"

namespace hackerrank {
namespace bmgandre {
namespace algorithms {
namespace strings {

using funny_string_test = hackerrank::bmgandre::tests::hackerrank_gtest;

TEST_F(funny_string_test, test_case_0_1) {
	auto output = funny_string::solve("acxz");

	ASSERT_EQ(output, "Funny");
}

TEST_F(funny_string_test, test_case_0_2) {
	auto output = funny_string::solve("bcxz");

	ASSERT_EQ(output, "Not Funny");
}

TEST_F(funny_string_test, test_case_1_1) {
	auto output = funny_string::solve("ivvkxq");

	ASSERT_EQ(output, "Not Funny");
}

TEST_F(funny_string_test, test_case_1_2) {
	auto output = funny_string::solve("ivvkx");

	ASSERT_EQ(output, "Not Funny");
}

TEST_F(funny_string_test, test_case_9_1) {
	auto output = funny_string::solve("");

	ASSERT_EQ(output, "Not Funny");
}

TEST_F(funny_string_test, test_case_9_2) {
	auto output = funny_string::solve("");

	ASSERT_EQ(output, "Funny");
}

TEST_F(funny_string_test, test_case_9_3) {
	auto output = funny_string::solve("");

	ASSERT_EQ(output, "Not Funny");
}

TEST_F(funny_string_test, test_case_9_4) {
	auto output = funny_string::solve("");

	ASSERT_EQ(output, "Funny");
}

} // namespace algorithms
} // namespace strings
} // namespace bmgandre
} // namespace hackerrank

int main(int argc, char** argv) {
	::testing::InitGoogleTest(&argc, argv);
	return RUN_ALL_TESTS();
}
